import React from 'react';
import ChordCard from '../ChordCard/ChordCard';

const ChordList = props => {
    const chords = props.chords.map(chord => {
        return <ChordCard chordName={chord.chordName} author={chord.author}/>
    })
    return <div className='chord-list'>{chords}</div>
}

export default ChordList;
